import React from 'react';
import './App.css';
import {Container,Row,Col} from 'react-bootstrap';

function App() {
  return (
    <div className='body'>
      <Container >
        <Row className='rows'>
          <Col className='columns' xs={3}>1 of 3</Col>
          <Col className='columns' xs={5}>2 of 3</Col>
          <Col className='columns' xs={4}>2 of 3</Col>
        </Row>
        <Row className='rows'>
          <Col className='columns'>1 of 3</Col>
          <Col className='columns'>2 of 3</Col>
          <Col className='columns'>3 of 3</Col>
        </Row>
      </Container>
    </div>
  );
}

export default App;
